import React,{useEffect} from 'react';
import { createTodo } from '../api/todo';

const ToDoComponent = () => {
    useEffect(()=>{

    },[])
    const onClickCreateTodo =(todos)=>{
        createTodo(todos).then((res)=>{
           console.log(res)
        })
        .catch((err) => {
            console.log(err)
            window.alert("createTodo error")
        })
    }
    const onClickGetTodos =()=>{
        createTodo(todos).then((res)=>{
           console.log(res)
        })
        .catch((err) => {
            console.log(err)
            window.alert("createTodo error")
        })
    }
    return (
        <div>
            <div>TODOLIST</div>
            <input/>
            <div onClick={onClickCreateTodo("gae")}>추가</div>
            <div>
                <div>밥 먹기</div>
                <div>라면 먹기</div>
            </div>
        </div>
    );
};

export default ToDoComponent;
